                        function Drag(e) {

                                if (isDragging) {

                                        OffSuppliesWindow.style.left = e.clientX - offsetX + 'px'
                                        OffSuppliesWindow.style.top = e.clientY - offsetY + 'px'

                                };

                        };

                        function EndDrag() {

                                isDragging = false

                        };

